import React from "react";
import { Link } from "react-router-dom";
import { TableRow, TableCell, IconButton, Tooltip} from "@material-ui/core";
import { VisibilitySharp, EditSharp, DeleteSharp } from '@material-ui/icons';
import axios from "axios";
const TableList = ({ id, firstname, lastname, email },props) => {
    const deleteStudent = () => {
        axios.delete(`http://localhost:3000/students/${id}`);
    }
    return (
        <>  
            <TableRow>
                <TableCell>{ 1}</TableCell>
                <TableCell>{firstname} {lastname}</TableCell>
                <TableCell>{email}</TableCell>
                <TableCell>
                    <Tooltip title='view' arrow>
                        <IconButton size="small">
                            <Link to={`/view/${id}`}><VisibilitySharp color='primary' /></Link>
                        </IconButton>
                    </Tooltip>
                    <Tooltip title='Edit' arrow>

                        <IconButton size="small">
                        <Link to={`/updateProfile/${id}`}><EditSharp /></Link>
                        </IconButton>
                    </Tooltip>

                    <Tooltip title='Delete' arrow>
                        <IconButton size="small" onClick={deleteStudent}>
                            <DeleteSharp  color='error' />
                        </IconButton>
                    </Tooltip>

                </TableCell>
            </TableRow>
            {console.log(props.index)}
        </>
    );
};

export default TableList;
